import { FunctionComponent } from "react";
import { useFormik } from "formik";
import * as yup from "yup";
import { addUser } from "../services/usersServices";

interface RegisterProps {
  setUserInfo: Function;
}

const Register: FunctionComponent<RegisterProps> = ({ setUserInfo }) => {
  let formik = useFormik({
    initialValues: {
      firstName: "",
      middleName: "",
      lastName: "",
      phone: "",
      email: "",
      password: "",
      imageUrl: "",
      imageAlt: "",
      state: "",
      country: "",
      city: "",
      street: "",
      houseNumber: 0,
      zip: "",
    },
    validationSchema: yup.object({
      firstName: yup.string().required().min(2, "Please enter a valid name"),
      middleName: yup.string().min(2),
      lastName: yup.string().required().min(2, "Please enter a valid name"),
      phone: yup.string().required().min(6, "Please enter a valid Phone number"),
      email: yup.string().required().email(),
      password: yup
        .string()
        // .required("Please Enter your password")
        .matches(
          /^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9]{4,})(?=.*[!@#\$%\^&\*]*-_)(?=.{8,})/,
          "Must Contain at least 8 Characters, One Uppercase, One Lowercase, at least 4 Numbers and One Special Case Character(!@#$%^&*-_*)"
        ),
      imageUrl: yup.string().required().url(),
      imageAlt: yup.string().required().min(2),
      state: yup.string(),
      country: yup.string().required(),
      city: yup.string().required(),
      street: yup.string().required(),
      houseNumber: yup.number().required(),
      zip: yup.string().required(),
    }),
    onSubmit({ ...values }) {
      addUser({ ...values, isAdmin: false })
        .then((res) => {
          sessionStorage.setItem(
            "userInfo",
            JSON.stringify({
              email: res.data.email,
              isAdmin: res.data.isAdmin,
              userId: res.data.id,
            })
          );
          setUserInfo(JSON.parse(sessionStorage.getItem("userInfo") as string));
        })
        .catch((err) => console.log(err));
    },
  });
  return (
    <>
      <div className="container-fluid col-md-3">
        <form onSubmit={formik.handleSubmit}>
          <h3 className="display-3">Register</h3>
          <div className="row">
            <div className="form-floating mb-3 col">
              <input
                type="text"
                className="form-control"
                id="firstName"
                placeholder="Your first name"
                name="firstName"
                value={formik.values.firstName}
                onChange={formik.handleChange}
